import React, { useState } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  Button
} from 'reactstrap';
import { NavLink } from 'react-router-dom';


const Header = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div>
      <Navbar className="bg-dark fixed-top"  expand="sm">
        <NavbarBrand href="/" className=" text-light fs-3 text pt-2 offset-1 "><i class="fa fa-leaf "></i> Ss-Foods</NavbarBrand>
        <NavbarToggler  onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="offset-3 pt-3 " navbar>
              <NavItem className="px-2">
                <NavLink className="text-light fs-6 text nav-link" to="/home"><i class="fa fa-home">-</i>Home</NavLink>
              </NavItem>
              <NavItem>
                <NavLink className="text-light fs-6 text nav-link" to="/about" ><i class="fa fa-info">-</i>About</NavLink>
              </NavItem>
              <NavItem className="px-2">
                <NavLink className="text-light fs-6 text nav-link " to="/contact">Contact</NavLink>
              </NavItem>
              <Button role="button" class="text-light  bg-dark outline-dark  fs-6 text" >
                        Sign-In / <span class="text-info">Register</span>
              </Button>
          </Nav>

        </Collapse>
      </Navbar>
    </div>
  );
}

export default Header;
